import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';
import { motion } from 'framer-motion';

const HowWeDoIt = () => {
  const [scrollY, setScrollY] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    const handleScroll = () => {
      setScrollY(window.scrollY);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const handleBackToHome = (e) => {
    e.preventDefault();
    // Add a custom flag to indicate direction for the home page animation
    navigate('/', { state: { slideDirection: 'left' } });
  };
  return (
    <motion.div
      initial={{ x: '100%' }}
      animate={{ x: 0 }}
      exit={{ x: '-100%' }} // Exit to the left when going back
      transition={{ type: 'tween', duration: 0.5 }}
      className="h-screen overflow-y-auto overflow-x-hidden"
    >
      <div className="fixed top-0 left-0 right-0 z-50">
        <Navbar />
      </div>
        {/* Main Content Section */}
      <main className="min-h-screen bg-white pt-20">
        {/* Overview Section */}
        <section className="max-w-4xl mx-auto px-6 py-16">
          <div className="text-center space-y-8">
            {/* Title with Carousel Dots */}
            <div className="space-y-4">
              <h1 className="text-4xl font-serif">Overview</h1>
              <div className="flex justify-center gap-2">
                <div className="w-2 h-2 rounded-full bg-pink-500"></div>
                <div className="w-2 h-2 rounded-full bg-gray-300"></div>
                <div className="w-2 h-2 rounded-full bg-gray-300"></div>
                <div className="w-2 h-2 rounded-full bg-gray-300"></div>
                <div className="w-2 h-2 rounded-full bg-gray-300"></div>
                <div className="w-2 h-2 rounded-full bg-gray-300"></div>
              </div>
            </div>

            {/* Subheading */}
            <h2 className="text-gray-500 text-xl font-light leading-relaxed">
              Afiniti Enterprise Behavioral Pairingâ„¢ discovers and predicts patterns of interpersonal behavior to optimally pair customers with agents.
            </h2>

            {/* Main paragraph */}
            <p className="text-gray-700 max-w-2xl mx-auto leading-relaxed">
              With over 150 patents, Afiniti's technology examines data and commercially available information tied to customer identity to determine patterns of successful behavioral interactions and applies these patterns in real time to drive improvements in health, enterprise profitability, and customer satisfaction.
            </p>

            {/* Video Container */}
            <div className="w-full max-w-3xl mx-auto aspect-video bg-gray-100 mt-12 rounded-lg overflow-hidden">
              <video 
                className="w-full h-full object-cover"
                controls
                src="https://res.cloudinary.com/ddzllbqlv/video/upload/v1748342620/zjtzamruh1ztnsjntam7.mp4"
              >
                Your browser does not support the video tag.
              </video>
            </div>
          </div>
        </section>
      </main>
    </motion.div>
  );
};

export default HowWeDoIt;
